**Describe the bug**
Hi everyone,
I am currently in the process using CUDA and OpenCV GpuMat to speed up resizing an image, Normalizing the image pixel by pixel,and converting an image to a tensor for the Session::Run() function. Originally, I do this with an std::vector which is then converted to a const float * for generating the output. I have successfully Normalized the image pixel by pixel and stored it into a dynamic C array as follows:

```
 __global__ void vectorNorm(float* imageArr, int N) {

	// Calculate global thread ID
	int tid = (blockIdx.x * blockDim.x) + threadIdx.x;

	// Boundary check
	if (tid < N) {
		// Each thread adds a single elem ent
		imageArr[tid] /= 255.0f;
	}
}
```
```
void GpuMatCudaOperation(float* imageVector, int N) {

	 float* imageArray;
	cudaMalloc(&imageArray, sizeof(float) * N);
	cudaMemcpy(imageArray, imageVector, N, cudaMemcpyHostToDevice);

	int NUM_THREADS = 1 << 10;
	int NUM_BLOCKS = (N + NUM_THREADS - 1) / NUM_THREADS;
	vectorNorm << <NUM_BLOCKS, NUM_THREADS >> > (imageArray, N);

	cudaMemcpy(imageVector, imageArray, N * sizeof(float), cudaMemcpyDeviceToHost);

	cudaFree(imageArray);
	free(imageVector);
	cout << "COMPLETED SUCCESSFULLY\n";
}
```

The only thing is that because C float * type is used, I am having trouble passing the float * into session::Run() as it wants a const float * type. However, I cannot use const float in my code since I want to edit the pixel values. Is there any way of converting to const float * without copying to a new dynamic C array?

